{'message': '不黑不吹，这个舞蹈的编舞本身就是业界大神，日本的SHIT KINGZ，EXO的3首主打舞蹈都是出自他们的。

还有就是不要因为粉谁就去诋毁别人的努力，这样既显自身素养问题，还会给自己喜欢的人招黑。音乐盒舞蹈本来就是带给人愉

