{'message': '超喜欢02.可是檀木素质好差，每个都说长死了、怎么这么长。物语歌曲都是这样好么，而且故事很美好么。

说BL恶心的自重，你可以不听啊，你不会拉进度条啊。而且在希腊那个年代男性之间的爱是最高尚的好么。
本来挺好的一首歌，被弹幕弄得完全没心情', 'plat': 0, 'device': ''}

{'message': '为什么，谁规定了人不能积累无限多财富呢？为什么这样就不公平?难道不是人的嫉妒心作祟么？

从历史发展规律来看，如果某一阶层能积累无限的财富，其它阶层越来越穷自然就会暴动，政府自然就垮台。东亚寥寥数千年的文明史却有成百的王朝，有无数次都是上层阶级无限剥削使底层、下层起义暴动。现代社会的福利制度就是为了避免重蹈覆辙。劫富济贫这种事要不要做、是否公平并不需要讨论，因为它是关乎现行制度下的社会存亡的。你不做，那么***，内战，垮台，能无限积累财富的人也会自然灭亡。
然而最可惜的一点就是，几千年，无数的“贵族阶层”被推翻，却又有无数的起义者成长为新的“贵族阶层”。人类本性的贪婪使得历史必然会一次又一次重演。', 'plat': 0, 'device': ''}

{'message': '亚里士多德政治哲学有两大核心概念：1. 目的。2. 荣誉。

政治的最高目的，是要培养公民品德，而社会机制只是实现这个目标的手段。像其他的，贸易协定、攻守同盟等等都不是，因为，这些协定目的范围太窄了，在这些协定之下，主体们仍然沿袭了以前的生活方式，所以不能算城邦，不算是政治社群。
	从分配物的用途去推出适当的分配。公民品德的最佳者，最善于审议共善者，而不是最有钱、最多数、最好看......公民品德最有益的才应该具有最高的政治权位和影响力。同事，这种人身居高位，获得最高荣誉，对公德也是一种表彰，进而可以发挥教化的作用。这里，正义的目的面和荣耀面又结合到了一起。', 'plat': 0, 'device': ''}

