{'message': '毛子当年也是找死的！经济不景气还维持上万的军用直升机，分为16个军区。编为51个坦克师、142个摩托化步兵师、7个空降师、约10个空中突击旅和16个方面军炮兵师，装备主战坦克5。3万辆、装甲战斗车辆6。3万辆、火炮2。9万门、地对地飞弹发射架约1570部。4个舰队和一个区舰队。装备弹道飞弹潜艇79艘，巡航飞弹潜艇和攻击潜艇268艘，主要水面作战舰只193艘，小型水面作战舰只797艘，登陆舰艇187艘，主要辅助船只269艘。　空军，人数为45。3万，远程航空兵约10万人，编为5个集团军，装备中远程轰炸机752架；方面军航空兵约31。5万人，编入12个军区和驻东欧四国苏军集群的空军序列，装备歼击机、歼击轰炸机和强击机5167架。513万军队（不含内务部和安全部队）防空军，人数为63。5万，编入5个防空区和10个军区的防空军序列。拥有各型歼击截击机1300架，防空飞弹发射架9600部，雷达约7000部，有反弹道飞弹发射架100部。

　　战略火箭军，人数29。8万，编为6个火箭集团军，有发射控制司令部300个。拥有洲际飞弹1398枚，战略作战飞机1690架。战略火箭军掌握着令人生畏苏联核武器库，是苏联的战略部队。

　　苏联另有边防军25万，内务部队35万。', 'plat': 0, 'device': ''}

